import LoginPage1 from '../pageobjects/login1.page'
import resources from '../resources'

describe('Roomex', () => {
    it('Verify Login Page Error message', async () => {
        LoginPage1.open()  
        expect(browser).toHaveTitle(resources.homeTitle) //Verify title
        LoginPage1.btnLogin.click() // Click Login Button
        expect(LoginPage1.emailError).toBeDisplayed()   //Email and Password required Error 
        expect(LoginPage1.emailError).toHaveTextContaining(resources.emailRequired)
        expect(LoginPage1.passwordError).toBeDisplayed()
        expect(LoginPage1.passwordError).toHaveTextContaining(resources.passwordRequired)
        await browser.pause(5000)
    });

    it('Verify ResetPassword Page Email and Password Required Error message', async () => {
        LoginPage1.openForgotPasswordPage()
        await browser.pause(10000)
        LoginPage1.inputEmail.setValue('bob@example.com') //Set Email id in input box
        await browser.pause(1000)
        LoginPage1.btnResetPassword.click()  // Click Reset Password button
        await browser.pause(10000)
        expect(LoginPage1.errorMessage).toBeDisplayed
        expect(LoginPage1.errorMessage).toHaveTextContaining(resources.emaildoesntexist)
        await browser.pause(10000)
    })
});

